<script lang="ts">
import { defineComponent } from "vue";
import "@/assets/css/Login.css";
import {
  login,
  getCode,
  register,
  getPreCode,
  forgetPassword,
} from "@/api/user/userApi";
import { message } from "@/utils/message";
import { storage } from "@/utils/storage";
import router from "@/router";
export default defineComponent({
  name: "login-home",
  data() {
    return {
      isChecked: false,
      loginClicked: true,
      registerClicked: false,
      LoginStatus: true,
      centerDialogVisible: false,
      loadingStatus: false,
      DialogTitle: "",
      hasSendCode: false,
      form: {
        email: "",
        code: "",
        password: "",
        repeatPassword: "",
      },
      preCode: {
        uuid: "",
        base64: "",
        inputCode: "",
        time: 0,
      },
      emailType: 0,
      preCodeDisabled: false,
    };
  },
  methods: {
    loginFunc() {
      if (this.form.email == "") {
        message.warning("请输入邮箱");
        return;
      }
      if (!this.checkEmain(this.form.email)) {
        message.warning("邮箱格式错误");
        return;
      }
      if (this.form.password == "") {
        message.warning("请输入密码");
        return;
      }
      let form = {
        email: this.form.email,
        password: this.form.password,
      };
      login(form).then((res: any) => {
        if (res.code == 200) {
          storage.set("token", res.data.token as string);
          message.success("登录成功");
          this.$router.go(0)
        } else {
          message.error(res.msg);
        }
      });
    },
    registerFunc() {
      if (this.form.password == "" || this.form.repeatPassword == "") {
        message.warning("请输入密码");
        return;
      }
      if (this.form.password != this.form.repeatPassword) {
        message.warning("两次密码输入不一致");
        return;
      }
      if (this.form.code == "") {
        message.warning("请输入验证码");
        return;
      }
      if (!this.isChecked) {
        message.warning("请先勾选同意用户协议");
        return;
      }
      let form = {
        email: this.form.email,
        emailCode: this.form.code,
        password: this.form.password,
      };
      register(form).then((res: any) => {
        if (res.code == 200) {
          message.success("注册成功");
          storage.set("token", res.data.token);
          router.go(0);
        } else {
          message.error(res.msg);
        }
      });
    },
    Return(){
      if(this.LoginStatus == false){
        this.form.repeatPassword = "";
        this.form.password = "";
        this.LoginStatus = true;
      }else{
        this.form.password = "";
        this.LoginStatus = false;
        this.emailType = 0;
        return;
      }
    },
    ForgetPassword() {
      this.DialogTitle = "Forget Password";
      this.centerDialogVisible = true;
    },
    loadImage() {
      this.loadingStatus = false;
    },
    sendCode(values: any) {
      if(this.preCode.time!=0)return
      if (this.form.email == "") {
        message.warning("请输入邮箱");
        return;
      }
      if (!this.checkEmain(this.form.email)) {
        message.warning("邮箱格式错误");
        return;
      }
      this.emailType = values == "Forget Password" ? 3 : 0;
      this.preCode.inputCode = "";
      this.DialogTitle = "验证码";
      this.centerDialogVisible = true;
      this.getPreCodeFunc();
    },
    checkEmain(email: string) {
      return /^([a-zA-Z]|[0-9])(\w|\\-)+@[a-zA-Z0-9]+\.([a-zA-Z]{2,4})$/.test(
        email,
      );
    },
    getPreCodeFunc() {
      if (this.preCodeDisabled) {
        return;
      }
      this.loadingStatus = true;
      getPreCode().then((res) => {
        this.preCode.uuid = res.data.uuid;
        this.preCode.base64 = res.data.base64;
        this.preCodeDisabled = false;
      });
    },
    handleComfirm() {
      if (this.DialogTitle == "验证码") {
        if (this.preCode.inputCode == "") {
          message.warning("请输入图片验证码");
          return;
        }
        // eslint-disable-next-line @typescript-eslint/no-this-alias
        let that = this;
        let form = {
          email: this.form.email,
          type: this.emailType,
          uuid: this.preCode.uuid,
          code: this.preCode.inputCode,
        };
        getCode(form).then((res: any) => {
          if (res.code == 200) {
            message.success("发送成功");
            this.hasSendCode = true;
            this.preCode.time = 60;
            setTimeout(function () {
              that.hasSendCode = false;
            }, 60000);
            this.centerDialogVisible = false;
            if (this.emailType == 3) {
              this.ForgetPassword();
            }
          } else {
            this.getPreCodeFunc()
            if (res.code == 529) {
              this.preCode.inputCode = "";
              message.error(res.msg);
            } else {
              this.centerDialogVisible = false;
              message.error(res.msg);
            }
          }
        });
      } else {
        if (this.form.code == "") {
          message.warning("请输入验证码");
          return;
        }
        if (this.form.password == "") {
          message.warning("请输入密码");
          return;
        }
        let form = {
          email: this.form.email,
          password: this.form.password,
          emailCode: this.form.code,
        };
        forgetPassword(form).then((res: any) => {
          if (res.code == 200) {
            message.success("修改成功");
            this.centerDialogVisible = false;
            router.go(0)
          } else {
            message.error(res.msg);
          }
        });
      }
    },
  },
  mounted() {
    let that = this;
    setInterval(function () {
      if (that.preCode.time != 0) {
        that.preCode.time--;
      }
    }, 1000)
    if (storage.get<string>('token')) {
      this.$router.replace('posts')
    }
  },
});
</script>

